void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = (fragCoord * 2.0 - iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;
    uv = fract(uv * 0.35) -0.5;

    vec3 finalColor = vec3(230., 190., 138.)/360.;


    float d = length(uv);
    d = tan(sin(d*7.)* sin(iTime)*15.);
    vec3 color = cos(vec3(14,23, 14)) * 10. * length(uv0);
    finalColor = mix(0.1/color, finalColor, d);
    fragColor = vec4(finalColor,1.0);
}
